INSERT INTO `notification` VALUES (1,'SMSA01','COLLECTION NOTE (1)\r\nHi #{DNM}#, this is a collection note on behalf of FleetOps and Vantage Ghana Ltd. Please log into http://fleetopsgh.com/driver - Enter your vehicle number and use the mobile number that has your active wallet account to make payment.\r\nThank you – FOVCollector2.1'),(2,'SMSA02','COLLECTION NOTE (2) – REMINDER\r\nHi #{DNM}#, Please log into http://fleetopsgh.com/driver - Enter your vehicle number and use the mobile number that has your active wallet account for payment.\r\nThank you – FOVCollector2.1'),(3,'SMSA03','COLLECTION NOTE (3) – WARNING\r\nHi #{DNM}#, we have sent you two reminders already, but have still not received payment from you. To avoid any inconveniences please make payment now.\r\nPlease log into http://fleetopsgh.com/driver - Enter your vehicle number and use the mobile number that has your active wallet account for payment.\r\nThank you – FOVCollector2.1'),(4,'SMSA04','VEHICLE BLOCKED\r\nHi #{DNM}#, we have been compelled to take the necessary actions to ensure you make payments. Your Car-Owner has been notified of this situation and has been advised to take the necessary actions. Make payments immediately to restore service. Please log into http://fleetopsgh.com/driver, enter your vehicle number and use the mobile number that has your active wallet account for payment. Tampering with the vehicle and or any installed devices shall attract a hefty fine, including and not limited, to time in jail or prison in accordance to the laws of the Republic of Ghana.\r\nThank you – FOVCollector2.1'),(5,'SMSA05','PAYMENT DEFAULT - ALERT\r\nHi #{CZN}#, we wish to bring to your attention that your driver #{DNM}# using vehicle number #{VNO}# has failed to make payments as agreed. We have activated our enforcement mechanisms to ensure payment is done accordingly. In the interim, we also advice that you contact your driver or else take the necessary actions to safeguard your vehicle from abuse and inappropriate tampering.\r\nThank you – FOVCollector2.1'),(6,'SMSB06','Message Sent by Cash collection service provider.'),(7,'SMSB07','RECEIPT\r\nHi, an amount of #{RMT}# has been received by FleetOps and Vantage Ghana Ltd.\r\nYour receipt no is #{RNO}#.\r\nThank you – FOVCollector2.1'),(8,'SMSC08','RH - OPERATIONS - ALERT\r\nHi #{CZN}#, we have detected that your driver #{DNM}# using vehicle number #{VNO}# may have failed to fully declare sales for work done. Please log into the ride hailing application and compare sales with declarations made on FOVCollector2.1 to resolve the case.  In the interim, we also advice that you contact your driver or else take the necessary actions to safeguard your vehicle from abuse and inappropriate tampering.\r\nThank you – FOVCollector2.1'),(9,'SMSD09','RH - OPERATIONS\r\nHi #{CZN}#, please be informed that upon declaration of sales, your driver #{DNM}# using vehicle number #{VNO}# may have consumed #{FTP}# litres of fuel for work done.\r\nThank you – FOVCollector2.1'),(10,'SMSD10','RH - OPERATIONS\r\nHi #{DNM}#, please be informed you have consumed #{FTP}# litres of fuel for work done.\r\nThank you – FOVCollector2.1'),(11,'SMSE11','RH - OPERATIONS\r\nHi #{CZN}#, please be informed that your driver #{DNM}# using vehicle number #{VNO}# has stated that he is unable to retrieve sales information from the Ride-Hailing App in use. Accordingly, we have taken steps to investigate and resolve the issue. In the interim, we also advice that you contact your driver or else take the necessary actions to safeguard your vehicle from abuse and inappropriate tampering.\r\nThank you – FOVCollector2.1'),(12,'SMSB08','RH - OPERATIONS\r\nHi  #{DNM}#  , Thank you for a successful sales declaration of GHC #{TOTAL}#. Cash Receipt of GHC #{RMT}# Confirmed!. Your receipt no is #{RNO}#. \r\nThank you – FOVCollector2.1'),(13,'SMSB09','RH - OPERATIONS\r\nHi  #{DNM}#  , GHC #{RMT}# Cash Receipt Confirmed! Your receipt no is #{RNO}#. \r\nPlease stand-by while we carry out some validation checks on your entries.\r\nThank you – FOVCollector2.1'),(14,'SMSE12','VEHICLE UNBLOCKED\r\nHi #{DNM}#, your vehicle has been unblocked successfully.\r\nThank you - FOVCollector2.1');
